css:
atom-pane atom-text-editor {
  padding-top: 5px;
  padding-bottom: 5px;
  max-height: auto !important;
}
span.punctuation.terminator.rule {
  color: #545d6e;
}
.line-number {
  -webkit-transition: all 0.2s ease-in-out;
  -moz-transition: all 0.2s ease-in-out;
  -o-transition: all 0.2s ease-in-out;
  transition: all 0.2s ease-in-out;
  border-left: 2px solid transparent;
}
.line-number.cursor-line {
  color: #5caef2 !important;
  border-color: #5caef2;
}
atom-text-editor::shadow .highlight.find-result .region {
  background: transparent;
  border: 1px solid #5caef2;
  border-radius: 0;
  box-shadow: 0 0 1px 1px #5caef2, 0 0 8px 0 #5caef2 inset;
}
.editor .selection .region {
  background: #353b45 !important;
}
.bracket-matcher .region {
  text-decoration: none;
  border-bottom: none;
  background: #3a404b;
  position: absolute;
  transform: scale(1.2);
}
.function.scss {
  color: #c473dc !important;
}
atom-text-editor,
:host {
  background-color: #282c34;
  color: #dadee5;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #343943;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #383e49;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #383e49;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282c34;
  color: #9ba4b4;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #282c34;
  color: #aab1bf;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #aab1bf;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #aab1bf;
}
atom-text-editor .invisible,
:host .invisible {
  color: #dadee5;
}
atom-text-editor .cursor,
:host .cursor {
  color: #dadee5;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #4a5160;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #c8ced6;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #545B68;
}
.keyword {
  color: #c473dc;
}
.keyword.control {
  color: #c473dc;
}
.keyword.operator {
  color: #dadee5;
}
.keyword.other.special-method {
  color: #5caef2;
}
.keyword.other.unit {
  color: #d2876d;
}
.storage {
  color: #c473dc;
}
.constant {
  color: #d2876d;
}
.constant.numeric {
  color: #d2876d;
}
.constant.other.symbol {
  color: #90bb71;
}
.variable {
  color: #5caef2;
}
.variable.interpolation {
  color: #ce3e49;
}
.variable.parameter.function {
  color: #dadee5;
}
.invalid.illegal {
  background-color: #d8676f;
  color: #282c34;
}
.string {
  color: #90bb71;
}
.string.regexp {
  color: #c839f1;
}
.string.regexp .source.ruby.embedded {
  color: #d2876d;
}
.string.other.link {
  color: #d8676f;
}
.punctuation.definition.comment {
  color: #545B68;
}
.punctuation.definition.string,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #dadee5;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #5caef2;
}
.punctuation.definition.bold {
  color: #d2876d;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #c38fc1;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d8676f;
}
.support.class {
  color: #d2876d;
}
.support.function {
  color: #dadee5;
}
.support.function.any-method {
  color: #5caef2;
}
.entity.name.function {
  color: #5caef2;
}
.entity.name.type {
  color: #d2876d;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #90bb71;
}
.entity.name.class,
.entity.name.type.class {
  color: #d2876d;
}
.entity.name.section {
  color: #5caef2;
}
.entity.name.tag {
  color: #d8676f;
}
.entity.other.attribute-name {
  color: #d2876d;
}
.entity.other.attribute-name.id {
  color: #5caef2;
}
.meta.class {
  color: #d2876d;
}
.meta.link {
  color: #d2876d;
}
.meta.require {
  color: #5caef2;
}
.meta.selector {
  color: #c38fc1;
}
.meta.separator {
  background-color: #aab1bf;
  color: #dadee5;
}
.none {
  color: #dadee5;
}
.markup.bold {
  color: #d2876d;
  font-weight: bold;
}
.markup.changed {
  color: #c38fc1;
}
.markup.deleted {
  color: #d8676f;
}
.markup.italic {
  color: #c38fc1;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #5caef2;
}
.markup.inserted {
  color: #90bb71;
}
.markup.list {
  color: #d8676f;
}
.markup.quote {
  color: #d2876d;
}
.markup.raw.inline {
  color: #90bb71;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #90bb71;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.important {
  color: #ce3e49;
}
